    false,nt"url": null,nt"notes": "This document describes observations of
    Swainson's Hawks at Kern NWR and Wildwood Road. It also includes a brief discussion
    of management strategies to promote Swainson's Hawk nesting at Kern NWR, as well
    as an attachment of observation summaries from 1991-1994. Swainson's hawks are mostly
    observed in the  vicinity of Kern in migratory flocks. These flocks are observed
     hunting and roosting in freshly swathed alfalfa fields, fields  where sheep are
    grazing and over areas being burned. These are  expected situations where Swainson's
    hawks are known to  congregate. Attachment 1 summarizes observations of swainson's
     hawks by refuge staff and other USFWS researchers since 1991.  This attachment
    also chronicles sightings of a successful nesting  pair near Kern NWR in 1994. This
    list should be considered  incomplete, as most sightings are opportunistic and may
    not  represent activity on a broader range around the Kern NWR. Most  activity in
    1994 centers on a few main sites which are detailed  below.",nt"owner_org":
